import React from "react";
import axios from "axios";

export default function setDefault(userTemp) {
  axios.defaults.baseURL = "https://mvn-task-manager.work/";
  let token = "";
  if (userTemp) {
    token = userTemp.token;
  }
  console.log(token);
  axios.defaults.headers.common["Authorization"] = `Bearer {userTemp }`;
}
